import React from "react";

export default function NoteCard({ note, onArchive, onDelete, onEdit }) {
  return (
    <div style={{
      border: "1px solid #ccc",
      padding: "10px",
      marginBottom: "10px",
      borderRadius: "5px"
    }}>
      <h3>{note.Title}</h3>
      <p>{note.Content}</p>
      <p>
        <strong>Status:</strong> {note.Archived ? "Archived" : "Active"}
      </p>
      {note.Category && (
        <p>
          <strong>Category:</strong> {note.Category.name}
        </p>
      )}

      <button onClick={() => onEdit(note)}>Edit</button>
      <button onClick={() => onArchive(note.ID)}>
        {note.Archived ? "Unarchive" : "Archive"}
      </button>
      <button onClick={() => onDelete(note.ID)}>Delete</button>
    </div>
  );
}
